import React from "react";
import ReactDOM from "react-dom";
import Card from "./Card";
import Link from "./Link";
import "./index.css"

function info(val){
  return  <Card key={val.id}
  sname ={val.sname} 
  imgsrc ={val.imgsrc} 
  title={val.title} 
  link ={val.links} 
   />
}


ReactDOM.render(
  <>
  <h1 className="heading_style">This is Heading </h1>

  {Link.map((val) => {
    return(
      <Card key={val.id}
        sname ={val.sname} 
        imgsrc ={val.imgsrc} 
        title={val.title} 
        link ={val.links} 
         />
      );
  })}
  
  
  </>   
    ,document.getElementById("root")
);
